pragma solidity 0.8.24;

error ProofLib__ECMulFailed();
error ProofLib__ECAddFailed();
error ProofLib__ECPairingFailed();
error ProofLib__GteSnarkScalarField();
error ProofLib__PairingLengthsFailed();

library ProofLib {
    struct G1Point {
        uint256 x;
        uint256 y;
    }
    // Encoding of field elements is: x[0] * z + x[1]
    struct G2Point {
        uint256[2] x;
        uint256[2] y;
    }
    struct Proof {
        G1Point a;
        G2Point b;
        G1Point c;
    }
    struct VerifyingKey {
        G1Point alfa1;
        G2Point beta2;
        G2Point gamma2;
        G2Point delta2;
        G1Point[] IC; // solhint-disable-line var-name-mixedcase
    }

    uint256 internal constant SNARK_SCALAR_FIELD =
        21888242871839275222246405745257275088548364400416034343698204186575808495617;
    uint256 internal constant SNARK_PRIME_P =
        21888242871839275222246405745257275088696311157297823662689037894645226208583;

    /// @return r the negation of p, i.e. p.addition(p.negate()) should be zero.
    function negate(G1Point memory p) internal pure returns (G1Point memory r) {
        if (p.x == 0 && p.y == 0) return G1Point(0, 0);
        uint256 y;
        unchecked {
            y = SNARK_PRIME_P - (p.y % SNARK_PRIME_P);
        }
        return G1Point(p.x, y);
    }

    /// @return r the sum of two points of G1
    function addition(G1Point memory p1, G1Point memory p2)
        internal
        view
        returns (G1Point memory r)
    {
        uint256[4] memory input;
        input[0] = p1.x;
        input[1] = p1.y;
        input[2] = p2.x;
        input[3] = p2.y;
        bool success;
        // solhint-disable-next-line no-inline-assembly
        assembly {
            success := staticcall(sub(gas(), 2000), 6, input, 0xc0, r, 0x60)
        }
        if (!success) revert ProofLib__ECAddFailed();
    }

    /// @return r the product of a point on G1 and a scalar, i.e.
    /// p == p.scalarMul(1) and p.addition(p) == p.scalarMul(2) for all points p.
    function scalarMul(G1Point memory p, uint256 s)
        internal
        view
        returns (G1Point memory r)
    {
        uint256[3] memory input;
        input[0] = p.x;
        input[1] = p.y;
        input[2] = s;
        bool success;
        // solhint-disable-next-line no-inline-assembly
        assembly {
            success := staticcall(sub(gas(), 2000), 7, input, 0x80, r, 0x60)
        }
        if (!success) revert ProofLib__ECMulFailed();
    }

    /// @return the result of computing the pairing check
    /// e(p1[0], p2[0]) *  .... * e(p1[n], p2[n]) == 1
    /// For example pairing([P1(), P1().negate()], [P2(), P2()]) should
    /// return true.
    function pairing(G1Point[] memory p1, G2Point[] memory p2)
        internal
        view
        returns (bool)
    {
        uint256 elements = p1.length;
        if (elements != p2.length) revert ProofLib__PairingLengthsFailed();
        uint256 inputSize = elements * 6;
        uint256[] memory input = new uint256[](inputSize);
        for (uint256 i = 0; i < elements; i++) {
            unchecked {
                input[i * 6 + 0] = p1[i].x;
                input[i * 6 + 1] = p1[i].y;
                input[i * 6 + 2] = p2[i].x[0];
                input[i * 6 + 3] = p2[i].x[1];
                input[i * 6 + 4] = p2[i].y[0];
                input[i * 6 + 5] = p2[i].y[1];
            }
        }
        uint256[1] memory out;
        bool success;
        // solhint-disable-next-line no-inline-assembly
        assembly {
            success := staticcall(
                sub(gas(), 2000),
                8,
                add(input, 0x20),
                mul(inputSize, 0x20),
                out,
                0x20
            )
        }
        if (!success) revert ProofLib__ECPairingFailed();
        return out[0] != 0;
    }

    /// Convenience method for a pairing check for four pairs.
    function pairingProd4(
        G1Point memory a1,
        G2Point memory a2,
        G1Point memory b1,
        G2Point memory b2,
        G1Point memory c1,
        G2Point memory c2,
        G1Point memory d1,
        G2Point memory d2
    ) internal view returns (bool) {
        G1Point[] memory p1 = new G1Point[](4);
        G2Point[] memory p2 = new G2Point[](4);
        p1[0] = a1;
        p1[1] = b1;
        p1[2] = c1;
        p1[3] = d1;
        p2[0] = a2;
        p2[1] = b2;
        p2[2] = c2;
        p2[3] = d2;
        return pairing(p1, p2);
    }

    function snarkHash(bytes memory data) internal pure returns (uint256) {
        return uint256(keccak256(data)) % SNARK_SCALAR_FIELD;
    }
}

